import styled from "styled-components";

function Header() {
  return (
    <Container>
      <Wrapper>
        <h1>Nepp Movie</h1>
        <NavBar>
          <nav>
            <ul>
              <li>영화</li>
              <li>프로그램</li>
              <li>인물</li>
              <li>More</li>
            </ul>
          </nav>
        </NavBar>
      </Wrapper>
    </Container>
  );
}

const Container = styled.div`
  background-color: #ddd;
`;

const Wrapper = styled.div`
  max-width: 900px;
  height: 60px;

  margin: 0 auto;
  background-color: #eee;
`;

const NavBar = styled.nav`
  display: flex;
`;

export default Header;
